import React, {Fragment} from 'react';
import {withNamespaces} from "react-i18next";
import Webcam from "react-webcam";


const RegisterVideo = () => {
    return (
        <Fragment>
            <Webcam />
        </Fragment>
    )
}

export default withNamespaces()(RegisterVideo);
